import Todos from "./components/Todos";
import React from "react";
import "./App.css";

class App extends React.Component {
  state = {
    todos: [
      {
        id: 1,
        tittle: "gör nåt",
        completed: false,
      },
      {
        id: 2,
        tittle: "rasta hunden",
        completed: true,
      },

      {
        id: 3,
        tittle: "äta nåt",
        completed: false,
      },
    ],
  };
  markComplete = (tittle) => {
    console.log(tittle);
  };

  render() {
    return <Todos todos={this.state.todos} markComplete={this.markComplete} />;
  }
}
export default App;
